import React, {FC} from "react"
import {TextField} from "@material-ui/core"
import {Field} from "formik"
import {CustomFieldProps} from "@root/interfaces/CustomFieldProps"


export const CustomFormikField: FC<CustomFieldProps> = (props) => {
    return (
        <Field name={props.name}>
            {
                ({field}) => (
                    <TextField
                        fullWidth
                        focused={false}
                        variant='outlined'
                        {...field}
                        {...props}
                    />
                )
            }
        </Field>
    )
};
